import './App.css';
import Nav from './components/navBar.js';
import Pages from './components/Pages.js';
import Footer from './components/Footer.js';
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return (
      <Router>
        <div></div>
        <Nav/>
        <Pages/>
        <Footer/>
      </Router>
  );
}

export default App;
